import { keyboard } from "@testing-library/user-event/dist/keyboard";
import React from "react";

export default function Meaning(param) {
  function Example(ex) {
    if (ex.eg !== undefined) {
      return <i>"{ex.eg}"</i>;
    }
    return "";
  }
  return (
    <div className="Meaning">
      <h3>{param.meaning.partOfSpeech}</h3>
      <ul>
        {param.meaning.definitions.map(function (item, key) {
          return (
            <div>
              <li key={item}>
                {item.definition}
                <br />
                <br />
                <Example eg={item.example} />
                <br />
                <div className="container">
                  <div className="row">
                    {item.synonyms.map(function (item, key) {
                      return (
                        <div className="synonym col-4" id={key}>
                          {item}
                        </div>
                      );
                    })}
                  </div>
                </div>
              </li>
            </div>
          );
        })}
      </ul>
    </div>
  );
}
